import { Injectable } from '@angular/core';
import { EvaluationRendement } from '../models/EvaluationRendement';
import { HttpClient, HttpResponse } from '@angular/common/http';
import { Observable } from 'rxjs';

@Injectable({
  providedIn: 'root'
})
export class RendementService {

  private apiUrl = 'https://localhost:7129/api/EvaluationRendements';

  constructor(private http: HttpClient) { }
  addev(EvaluationRendement: EvaluationRendement): Observable<HttpResponse<any>> {
    console.log('Creating it with data:', EvaluationRendement);

    return this.http.post<any>(`${this.apiUrl}/addev`, EvaluationRendement, { observe: 'response' });
  }}
